export const initialState = {
	mainPosts:[{
		id:1,
		User:{
			id:1,
			nickname:'zerocho'
		},
		content:'첫 번째 게시글 #해시태그 #express'
	}],
}

const reducer = (state=initialState, action) => {
    switch ( action.type ) {
        default:
            return state;
    }
}

export default reducer;
